import React from "react";

const Sidebar = () => {
    return (
        <div>
            <h2>메뉴 선택하기</h2>
            <ul>
                <li>메뉴1</li>
                <li>메뉴2</li>
                <li>메뉴3</li>
            </ul>
        </div>
    );
};

export default Sidebar;
